  const {user} = useContext
  return (
    <div>
      <Navbar />
      <div className="flex items-center justify-center h-screen">
        <h1 className="text-4xl font-bold">Welcome to YourHR!</h1>
        <UploadResume/>
      </div>
      <Dashboard/>
    </div>
  );
}

export default Home;
